webpackJsonp([0xf5b96fa5178b],{345:function(t,a){t.exports={data:{markdownRemark:{html:'<p><img src="/static/DatAsteroid.jpg"></p>\n<p>Game Jam Vancouver 2015 - Dat Asteroid!</p>\n<p><strong>About:</strong>\nIn the span of 48 hours, our team made a 2 player game, where the objective was to shoot an asteroid to the opponent\'s goal.\nThe game has spaceships that shoot lasers, an asteroid that interacted with all physical objects, and a fun soundtrack.\nWe demoed the game at the end of the event and had a lot of fun playing it.</p>\n<p><strong>Link:</strong><br>\nThe team photo and game can be found at our Global Game Jam 2015 page: <a href="https://globalgamejam.org/2015/games/dat-asteroid">Dat Asteroid</a>.\nTry playing the game with a friend!</p>\n<p><strong>Team:</strong><br>\nThe team was made up of 8 people (6 developers, 1 sfx artist, and 1 music producer).\nIt was a very fun event and I met over half of my team members at the event.</p>\n<p><strong>Work:</strong><br>\nThe game was written using C# and Unity 3D Engine.\nI worked on the audio mechanics, audio interactions, and some UI functionalities.</p>\n<p><img src="/static/DatAsteroid2.jpg"></p>',frontmatter:{date:"October 30, 2018",path:"/DatAsteroid",title:"Dat Asteroid",image:"/static/DatAsteroid.jpg"}}},pathContext:{}}}});
